import hero from "./images/hero.svg";

import gynaecology from "./images/specialities/gynaecology.png";
import laparoscopy from "./images/specialities/laparoscopy.png";
import proctology from "./images/specialities/proctology.png";
import ent from "./images/specialities/ENT2.jpg";
import orthopedics from "./images/specialities/Orthopadic.jpg";
import dentistry from "./images/specialities/Dentistry1.jpg";
import dermatology from "./images/specialities/AestheticsImage1.jpg";
import physiotherapy from "./images/specialities/Physiotherapy.jpg";
import diet from "./images/specialities/WeightLossImage2.jpg";
import respiratory from "./images/specialities/Respiratory2.jpg";
import medicine from "./images/specialities/Medicine.jpg";
import homeopathy from "./images/specialities/Homoeopathy.jpg";

import adenoidectomy from "./images/treatment/adenoidectomy.png";
import dental_braces from "./images/treatment/dental_braces.svg";
import dental_implant from "./images/treatment/dental_implant.svg";
// import diabetic_foot_ulcers from "./images/treatment/diabetic_foot_ulcers.svg";
import fess from "./images/treatment/fess.png";
import gynecosmatia from "./images/treatment/gynecosmatia.svg";
import hair_transplant from "./images/treatment/hair_transplant.svg";
// import laser_circumcision from "./images/treatment/laser_circumcision.svg";
import piles from "./images/treatment/piles.svg";
// import rhinoplasty from "./images/treatment/rhinoplasty.svg";
// import sebaceous_cyst from "./images/treatment/sebaceous_cyst.svg";
import septoplasty from "./images/treatment/septoplasty.svg";
import teeth_aligners from "./images/treatment/teeth_aligners.svg";
import tonsil from "./images/treatment/tonsil.svg";
import typanoplasty from "./images/treatment/typanoplasty.png";

import doctor_1 from "./images/doctors/doctor_1.jpeg";
import doctor_2 from "./images/doctors/doctor_2.jpeg";
import doctor_3 from "./images/doctors/doctor_3.jpeg";
import doctor_4 from "./images/doctors/doctor_4.jpeg";
import doctor_5 from "./images/doctors/doctor_5.jpeg";
import doctor_6 from "./images/doctors/doctor_6.jpeg";
import doctor_7 from "./images/doctors/doctor_7.jpeg";

import logo from "./images/logo.webp";
import primeLogo from "./images/primeLogo.png";

export const assets = {
  logo,
  primeLogo,
  hero,
  specialities: {
    gynaecology,
    laparoscopy,
    proctology,
    ent,
    orthopedics,
    dentistry,
    dermatology,
    physiotherapy,
    diet,
    respiratory,
    medicine,
    homeopathy
  },
  treatment: {
    adenoidectomy,
    dental_braces,
    dental_implant,
    // diabetic_foot_ulcers,
    fess,
    gynecosmatia,
    hair_transplant,
    // laser_circumcision,
    piles,
    //   rhinoplasty,
    //   sebaceous_cyst,
    septoplasty,
    teeth_aligners,
    tonsil,
    typanoplasty,
  },
  doctors: {
    doctor_1,
    doctor_2,
    doctor_3,
    doctor_4,
    doctor_5,
    doctor_6,
    doctor_7,
  },
};
